def svg(g: str, sizes):
    x_min, y_min, s_w, s_h, w, h = sizes
    return (f'<svg '
            f'width="{w}" height="{h}" '
            f'viewBox="{x_min} {y_min} {s_w} {s_h}" '
            f'>{g}</svg>')

